import React, {Component} from 'react'

export default class Insert extends Component{
	render(){
		return(
			<div>
				<form>
					<div className="form-control">
						<label>Username</label>
						<input type="text" name="uername" placeholder="Username" className="form-control"/>
					</div>
				</form>
			</div>
		)
	}
}
